import './BarraPesquisa.css';

function BarraPesquisa(props){
    

    return(
        <div className="BarraPesquisa">
            <input onSubmit={aoPesquisar()}/>
            <select onClick={(evento) => props.alteraFiltro(evento.target.value)}>
                <option></option>
                <option>Livro</option>
                <option>Biblioteca</option>         
                <option>Genero</option>
                <option>Autor</option>
            </select>
        </div>
    )
}
export default BarraPesquisa;
